// App.js
import React, { useState, useEffect } from 'react';
import axios from 'axios';
import MapView from './MapView';

function App() {
  const [parkingLots, setParkingLots] = useState([]);
  const [classLocation, setClassLocation] = useState([43.002, -78.787]); // Default coordinates
  const [time, setTime] = useState('08:00');

  useEffect(() => {
    const fetchParkingLots = async () => {
      try {
        const response = await axios.post('http://localhost:5000/api/suggest-parking', {
          classLocation,
          time,
        });
        setParkingLots(response.data);
      } catch (error) {
        console.error('Error fetching parking lots:', error);
      }
    };
    fetchParkingLots();
  }, [classLocation, time]);

  const handleClassLocationChange = (event) => {
    // Example: Convert building name to coordinates
    const locationMap = {
      'Building A': [43.002, -78.787],
      'Building B': [43.003, -78.788],
      // ...more buildings
    };
    setClassLocation(locationMap[event.target.value] || classLocation);
  };

  const handleTimeChange = (event) => {
    setTime(event.target.value);
  };

  return (
    <div>
      <h1>Campus Parking Finder</h1>
      <div>
        <label>
          Class Location:
          <select onChange={handleClassLocationChange}>
            <option value="">Select a building</option>
            <option value="Building A">Building A</option>
            <option value="Building B">Building B</option>
            {/* Add more options as needed */}
          </select>
        </label>
        <label>
          Arrival Time:
          <input type="time" value={time} onChange={handleTimeChange} />
        </label>
      </div>
      <MapView parkingLots={parkingLots} classLocation={classLocation} />
    </div>
  );
}

export default App;
